# 1. 题目描述
给定一个字符串 s，找到 s 中最长的回文子串。你可以假设 s 的最大长度为 1000。

示例 1：
输入: "babad"
输出: "bab"
注意: "aba" 也是一个有效答案。

示例 2：
输入: "cbbd"
输出: "bb"

# 2. 解答
## 方法一：动态规划
### 思路
使用动态规划来解决这个问题。我们定义 dp[i][j] 表示子串 s[i..j] 是否为回文子串。
- 当子串长度为1时，即 i=j，则 dp[i][j]=true。
- 当子串长度为2时，即 j=i+1，则 dp[i][j] = (s[i] == s[j])。
- 当子串长度大于2时，dp[i][j] = (s[i] == s[j]) && dp[i+1][j-1]。
  注意：这里需要保证 i+1 <= j-1，也就是子串长度大于2。

我们用一个二维数组 dp 来记录每个子串的状态，同时记录最长回文子串的起始位置和长度。

### 复杂度
- 时间复杂度：O(n^2)，其中 n 是字符串的长度。
- 空间复杂度：O(n^2)，需要存储一个二维数组。

### 代码
```javascript
var longestPalindrome = function(s) {
    const n = s.length;
    if (n < 2) return s;

    // 创建二维数组 dp
    const dp = new Array(n).fill(false).map(() => new Array(n).fill(false));
    let maxLen = 1;
    let start = 0;

    // 初始化：所有长度为1的子串都是回文
    for (let i = 0; i < n; i++) {
        dp[i][i] = true;
    }

    // 枚举子串长度，从2开始
    for (let L = 2; L <= n; L++) {
        for (let i = 0; i < n; i++) {
            // j 是子串结束位置
            let j = i + L - 1;
            if (j >= n) break;

            if (s[i] !== s[j]) {
                dp[i][j] = false;
            } else {
                if (j - i < 3) { // 子串长度2或3
                    dp[i][j] = true;
                } else {
                    dp[i][j] = dp[i+1][j-1];
                }
            }

            // 如果当前子串是回文，且长度大于当前最大长度，更新
            if (dp[i][j] && j - i + 1 > maxLen) {
                maxLen = j - i + 1;
                start = i;
            }
        }
    }

    return s.substring(start, start + maxLen);
};
```

## 方法二：中心扩展法
### 思路
回文中心可能是一个字符（奇数长度）或者两个字符（偶数长度）。因此，我们可以遍历每一个可能的中心，然后向两边扩展，直到不是回文为止。

### 复杂度
- 时间复杂度：O(n^2)，其中 n 是字符串的长度。有 2n-1 个中心，每个中心扩展最多需要 O(n) 时间。
- 空间复杂度：O(1)。

### 代码
```javascript
var longestPalindrome = function(s) {
    if (s.length < 1) return "";
    let start = 0, end = 0;

    for (let i = 0; i < s.length; i++) {
        // 奇数长度
        let len1 = expandAroundCenter(s, i, i);
        // 偶数长度
        let len2 = expandAroundCenter(s, i, i+1);
        let len = Math.max(len1, len2);
        if (len > end - start) {
            start = i - Math.floor((len - 1) / 2);
            end = i + Math.floor(len / 2);
        }
    }

    return s.substring(start, end + 1);
};

function expandAroundCenter(s, left, right) {
    while (left >= 0 && right < s.length && s[left] === s[right]) {
        left--;
        right++;
    }
