# 1. Problem Analysis
The problem requires us to find the number of distinct ways to climb to the top of a staircase with `n` steps. Each time, you can climb either 1 or 2 steps. This is a classic dynamic programming problem that resembles the Fibonacci sequence.

# 2. Intuition
The key observation is that the number of ways to reach step `n` is the sum of the ways to reach step `n-1` (if we take 1 step) and step `n-2` (if we take 2 steps). Therefore, the solution for step `n` is the nth Fibonacci number.

# 3. Algorithm Selection
We can solve this using dynamic programming by iteratively computing the number of ways for each step from 0 to `n`. Alternatively, we can use memoization to avoid recalculating the same subproblems. However, since the recurrence is simple, an iterative approach with constant space is efficient.

# 4. Complexity Analysis
- **Time Complexity**: O(n) because we iterate from 1 to n once.
- **Space Complexity**: O(1) because we only store the last two values.

# 5. Code Implementation
```python
class Solution:
    def climbStairs(self, n: int) -> int:
        if n <= 2:
            return n
        a, b = 1, 2
        for _ in range(3, n+1):
            a, b = b, a + b
        return b
```

# 6. Explanation
- **Base Cases**: If `n` is 1, there's only 1 way; if `n` is 2, there are 2 ways (1+1 or 2).
- **Iteration**: For each step from 3 to `n`, update the current number of ways as the sum of the previous two steps' ways. This is done by shifting the variables `a` and `b` where `a` becomes the old `b` and `b` becomes `a + b`.
- **Result**: After the loop, `b` holds the number of ways to reach the top.

