// 题目：给定一个数组，找出所有满足 a + b + c = 0 的三元组，要求不重复。
// 思路：排序 + 双指针
// 注意：跳过重复元素以避免重复三元组。

#include <vector>
#include <algorithm>
using namespace std;

class Solution {
public:
    vector<vector<int>> threeSum(vector<int>& nums) {
        vector<vector<int>> res;
        sort(nums.begin(), nums.end()); // 排序

        for (int i = 0; i < nums.size(); i++) {
            if (i > 0 && nums[i] == nums[i-1]) continue; // 跳过重复的第一个数

            int left = i + 1, right = nums.size() - 1;
            while (left < right) {
                int sum = nums[i] + nums[left] + nums[right];
                if (sum == 0) {
                    res.push_back({nums[i], nums[left], nums[right]});
                    // 跳过重复的第二个数
                    while (left < right && nums[left] == nums[left+1]) left++;
                    // 跳过重复的第三个数
                    while (left < right && nums[right] == nums[right-1]) right--;
                    left++;
                    right--;
                } else if (sum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }
        return res;
    }
};

// 测试
int main() {
    Solution sol;
    vector<int> nums = {-1, 0, 1, 2, -1, -4};
    vector<vector<int>> result = sol.threeSum(nums);
    // 输出结果略
    return 0;
}

/*
代码实现：
1. 首先对数组进行排序。
2. 遍历数组，固定第一个数 nums[i]。
3. 使用双指针 left 和 right 分别指向 i+1 和数组末尾。
4. 计算三数之和：
   - 如果等于0，记录三元组，并跳过重复的 left 和 right。
   - 如果小于0，left 右移。
   - 如果大于0，right 左移。
5. 注意跳过重复的第一个数（i 重复）以避免重复三元组。

时间复杂度：O(n^2)，排序 O(n log n)，双指针遍历 O(n^2)。
空间复杂度：O(1) 或 O(n)（取决于排序算法）。
