To write a string to a file in Java, you can use several approaches. Below are three common methods with examples:

### 1. Using `FileWriter` (Simple, no buffering)
```java
import java.io.FileWriter;
import java.io.IOException;

public class WriteToFile {
    public static void main(String[] args) {
        String content = "Hello, World!";
        String filePath = "output.txt";

        try (FileWriter writer = new FileWriter(filePath)) {
            writer.write(content);
            System.out.println("Successfully wrote to the file.");
        } catch (IOException e) {
            System.err.println("An error occurred: " + e.getMessage());
        }
    }
}
```

### 2. Using `BufferedWriter` (Efficient for multiple writes)
```java
import java.io.BufferedWriter;
import java.io.FileWriter;
import java.io.IOException;

public class WriteToFile {
    public static void main(String[] args) {
        String content = "Hello, World!";
        String filePath = "output.txt";

        try (BufferedWriter writer = new BufferedWriter(new FileWriter(filePath))) {
            writer.write(content);
            System.out.println("Successfully wrote to the file.");
        } catch (IOException e) {
            System.err.println("An error occurred: " + e.getMessage());
        }
    }
}
```

### 3. Using `Files.write()` (Java 7+, Simplest way)
```java
import java.nio.file.Files;
import java.nio.file.Paths;
import java.io.IOException;

public class WriteToFile {
    public static void main(String[] args) {
        String content = "Hello, World!";
        String filePath = "output.txt";

        try {
            Files.write(Paths.get(filePath), content.getBytes());
            System.out.println("Successfully wrote to the file.");
        } catch (IOException e) {
            System.err.println("An error occurred: " + e.getMessage());
        }
    }
}
```

### Key Notes:
- **Appending to File**: Use `FileWriter(filePath, true)` or `Files.write(..., StandardOpenOption.APPEND)`.
- **Character Encoding**: Specify encoding (e.g., `content.getBytes(StandardCharsets.UTF_8)`) in `Files.write()`.
- **Exception Handling**: Always handle `IOException`.
- **Resource Management**: Use try-with-resources (as shown) to auto-close writers.

Choose the method that best fits your needs:
- For simple writes: `Files.write()` (Java 7+).
- For frequent writes: `BufferedWriter`.
